import React from 'react';

function LeaveBalanceTable({ balances }) {
  return (
    <table className="elms-table">
      <thead>
        <tr>
          <th>Leave Type</th>
          <th>Balance</th>
        </tr>
      </thead>
      <tbody>
        {balances.map(lb => (
          <tr key={lb.leaveTypeId || lb.leaveType?.id}>
            <td>{lb.leaveType?.type || lb.leaveTypeId}</td>
            <td>{lb.balance}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
export default LeaveBalanceTable;
